const Contact = () => (
  <div className="contact">
    <div className="contact--details">
      <h1>Contact</h1>
      <p>
        Have any questions? Let's talk! I am always open for new opportunities
        and friendships!
      </p>
    </div>
    <button className="btn">CALL TO ACTION</button>
    <style jsx>
      {`
        .contact {
          display: block;
          text-align: center;
          margin-bottom: 50px;
        }
        .btn {
          font-size: 15px;
          padding: 10px;
        }
      `}
    </style>
  </div>
);

export default Contact;
